// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "@openzeppelin/contracts/access/Ownable.sol"; // For admin functions
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol"; // Prevent reentrancy attacks

contract InsurancePolicy is Ownable, ReentrancyGuard {

    struct Policy {
        address policyHolder;
        uint premiumPaid;
        uint coverageAmount;
        uint startTime;
        uint expiryTime;
        bool isActive;
        bool claimApproved;
        bool claimPaid;
    }

    // Mapping from policyholder address to their policy details
    mapping(address => Policy) public policies;
    address[] public policyHolders; // Keep track of who has policies

    uint public premiumAmount; // Cost to buy a policy
    uint public coverageAmount; // Payout amount on approved claim
    uint public policyDuration; // Duration of the policy in seconds

    event PolicyPurchased(address indexed policyHolder, uint premium, uint coverage, uint expiry);
    event ClaimFiled(address indexed policyHolder);
    event ClaimApproved(address indexed policyHolder, uint amount);
    event ClaimPaid(address indexed policyHolder, uint amount);
    event FundsWithdrawn(address indexed owner, uint amount);

    modifier onlyPolicyholder() {
        require(policies[msg.sender].policyHolder == msg.sender && policies[msg.sender].isActive, "Caller is not an active policyholder");
        _;
    }

    // --- Constructor ---
    constructor(uint _initialPremium, uint _initialCoverage, uint _durationInSeconds) Ownable(msg.sender) {
        require(_initialPremium > 0, "Premium must be positive");
        require(_initialCoverage > 0, "Coverage must be positive");
        require(_durationInSeconds > 0, "Duration must be positive");

        premiumAmount = _initialPremium;
        coverageAmount = _initialCoverage;
        policyDuration = _durationInSeconds;
    }

    // --- Policy Management ---

    function buyPolicy() external payable nonReentrant {
        require(msg.value == premiumAmount, "Incorrect premium amount sent");
        // Optional: Check if user already has an active policy if only one is allowed
        require(policies[msg.sender].policyHolder == address(0) || !policies[msg.sender].isActive || block.timestamp >= policies[msg.sender].expiryTime, "Already have an active policy");

        uint startTime = block.timestamp;
        uint expiryTime = startTime + policyDuration;

        // If it's a new holder, add them to the list
        if (policies[msg.sender].policyHolder == address(0)) {
             policyHolders.push(msg.sender);
        }

        policies[msg.sender] = Policy({
            policyHolder: msg.sender,
            premiumPaid: msg.value,
            coverageAmount: coverageAmount,
            startTime: startTime,
            expiryTime: expiryTime,
            isActive: true,
            claimApproved: false,
            claimPaid: false
        });

        emit PolicyPurchased(msg.sender, msg.value, coverageAmount, expiryTime);
    }

    // --- Claim Process (Simplified) ---
    // In reality, this needs an oracle or robust verification

    function fileClaim() external onlyPolicyholder nonReentrant {
        Policy storage policy = policies[msg.sender];
        require(block.timestamp < policy.expiryTime, "Policy has expired");
        require(!policy.claimApproved && !policy.claimPaid, "Claim already processed or approved");

        // Basic check: Ensure policy is active.
        // Add more complex claim validation logic here or via an oracle trigger.
        // For this example, we'll just mark it as filed and let the owner approve.
         emit ClaimFiled(msg.sender);
        // In a more automated system, you might directly check conditions here.
    }

    // Owner function to approve a claim (replace with oracle/DAO in real system)
    function approveClaim(address _policyHolder) external onlyOwner {
        Policy storage policy = policies[_policyHolder];
        require(policy.policyHolder != address(0), "Policyholder not found");
        require(policy.isActive, "Policy is not active");
        require(block.timestamp < policy.expiryTime, "Policy has expired"); // Can approve after expiry if claim filed before
        require(!policy.claimApproved, "Claim already approved");
        require(!policy.claimPaid, "Claim already paid");
        // Ensure contract has enough balance
        require(address(this).balance >= policy.coverageAmount, "Insufficient contract balance for payout");

        policy.claimApproved = true;
        emit ClaimApproved(_policyHolder, policy.coverageAmount);
    }

    function withdrawClaimPayout() external onlyPolicyholder nonReentrant {
        Policy storage policy = policies[msg.sender];
        require(policy.claimApproved, "Claim not approved");
        require(!policy.claimPaid, "Claim already paid");

        policy.claimPaid = true; // Mark as paid *before* sending Ether (Checks-Effects-Interactions pattern)
        policy.isActive = false; // Policy is now used up

        (bool success, ) = msg.sender.call{value: policy.coverageAmount}("");
        require(success, "Payout transfer failed");

        emit ClaimPaid(msg.sender, policy.coverageAmount);
    }

    // --- Utility Functions ---

    function getPolicyDetails(address _holder) external view returns (Policy memory) {
         return policies[_holder];
    }

    function checkPolicyActive(address _holder) external view returns (bool) {
        return policies[_holder].isActive && block.timestamp < policies[_holder].expiryTime;
    }

     function getPolicyHolders() external view returns (address[] memory) {
        return policyHolders;
    }

    // --- Admin Functions ---

    function setPremium(uint _newPremium) external onlyOwner {
         require(_newPremium > 0, "Premium must be positive");
         premiumAmount = _newPremium;
    }

    function setCoverage(uint _newCoverage) external onlyOwner {
         require(_newCoverage > 0, "Coverage must be positive");
         coverageAmount = _newCoverage;
    }

     function setDuration(uint _newDuration) external onlyOwner {
         require(_newDuration > 0, "Duration must be positive");
         policyDuration = _newDuration;
    }

    function withdrawFunds() external onlyOwner nonReentrant {
        uint balance = address(this).balance;
        // Optional: Leave some funds for pending claims? This is basic.
        require(balance > 0, "No funds to withdraw");
        (bool success, ) = owner().call{value: balance}("");
        require(success, "Withdrawal failed");
        emit FundsWithdrawn(owner(), balance);
    }

    // Allow contract to receive Ether directly (e.g., for initial funding)
    receive() external payable {}
}

